const Sidebar = () => {
    return ( 
        <div id="sidenav">
            <a href="/">/home</a>
            <a href="/">/about</a>
            <a href="/">/experience</a>
            <a href="/">/software-creations</a>

            <div className="sidebarlogos">
                <a href="/"><EmailRoundedIcon></EmailRoundedIcon></a>
                <a href="/"><GitHubIcon></GitHubIcon></a>
                <a href="/"><LinkedInIcon></LinkedInIcon></a>
            </div>    
        </div>
     );
}

export default Sidebar;
